<p class="GlossaryHeading">Nonpersonnel Sub-Category</p>
<p class="C1HPopupTopicText">Nonpersonnel items that are mapped to existing object 
codes. Each <a id="popup_47395" onclick="return d2hpopup(event, this.href)" href="gloss_nonpersonnelcategory.htm">Nonpersonnel Category</a> is associated 
with two or more sub-categories. Each sub-category is mapped to an individual <a id="popup_47396" onclick="return d2hpopup(event, this.href)" href="gloss_objectcode2.htm">object code</a>.</p></body></html>
